import Meal from "./Meal";

const Category = (props) => {
  return (
    <>
      <h3>{props.name}</h3>
      <div className="meals-container">
        {props.meals.map((meal, index) => {
          return (
            <Meal
              title={meal.title}
              description={meal.description}
              price={meal.price}
              popular={meal.popular}
            />
          );
        })}
      </div>
    </>
  );
};

export default Category;
